"""
Winston was given the above mysterious function func. He has an integer array arr and an integer target and he wants to
find the values l and r that make the value |func(arr, l, r) - target| minimum possible.

Return the min possible value of |func(arr, l, r) - target|, where func(arr, l, r) = arr[l] & arr[l+1] & ... & arr[r]

Notice that func should be called with the values l and r where 0 <= l, r < arr.length.
"""
from typing import List


def closest_to_target(arr: List[int], target: int) -> int:
    """
    :param arr: list of integer
    :param target: target to compute min absolute difference against
    :return: min possible value of |func(arr, l, r) - target|, where func(arr, l, r) = arr[l] & arr[l+1] & ... & arr[r]
    """
    and_to_j = set()  # set of a_i_j = arr[i] & ... & arr[j] for 0 <= i <= j
    min_abs_difference = float("inf")
    for a_j in arr:
        and_to_j = {a_j} | {a_i_j & a_j for a_i_j in and_to_j}
        min_abs_difference = min(min_abs_difference, min(abs(a_i_j - target) for a_i_j in and_to_j))
        if min_abs_difference == 0:
            return 0
        # Optimization step:
        # given l, func(arr, l, r) is monotonically non increasing
        # i.e. arr[l] & ... & arr[r] >= arr[l] & ... & arr[r] & arr[r+1]
        # filter out all a_i_j < target
        and_to_j = filter(lambda x: x >= target, and_to_j)
    return min_abs_difference


